  if (partes.length === 1) return primeira;
  if (partes.length === 2) return `${primeira}${separador}${ultima}`;

  const meio = partes.slice(1, -1).map(p => `<span style="color:#6B7280; font-weight:4  00;">${p}</span>`).join(separador);
